import FactList from "./FactList";
import Card from "./Card";

export default class Game {
  clues: FactList;
  timeline: FactList;
  score: number;

  constructor(clues: FactList = new FactList([new Card({info: "racon"})]),
              timeline: FactList = new FactList(), 
              score: number = 0) {
    this.clues = clues;
    this.timeline = timeline;
    this.score = score;
  }
}
